script: |
  super -f text -I q12365.spq | sort > q12365.out

inputs:
  - name: q12365.spq
    data: |
      SELECT DISTINCT + col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT IN ( 5 * + col2, - 95 - col0 + col2 * + 81, + 4, + col0 * 25 + + 43 * 84, col2, + 22 );
  - name: tab0

outputs:
  - name: q12365.out
    data: |
      1
      21
      81
